# 统计单张图像中对象个数和完整关键点组数
import os
import re

from matplotlib import pyplot as plt


def count_img_obj_K6(img_path):
    f = open(img_path, 'r', encoding='utf-8')
    lines = f.readlines()  # 读取整个文件所有行，保存在 list 列表中
    # 存放每个对象的目标框和关键点信息的list
    a = []
    # 统计当前图像中存在的嫩芽对象个数
    img_obj_n = 0
    # 统计当前图像中存在完整的6个关键点的组数
    img_k6_n = 0
    for line in lines:
        a = line.split(" ")
        if len(a) == 17:
            img_k6_n = img_k6_n + 1
            img_obj_n = img_obj_n + 1
        else:
            img_obj_n = img_obj_n + 1
    return img_obj_n, img_k6_n


